import React, { FC } from 'react';

import { Button, PageHeader } from 'antd';

import 'antd/dist/antd.css';
import './header.scss';

const Header: FC = () => (
  <div className="site-page-header-ghost-wrapper">
    <PageHeader
      ghost={false}
      title="Posts"
      extra={[
        <Button onClick={() => alert('name')}>by Name</Button>,
        <Button onClick={() => alert('title')}>by Title</Button>,
        <Button onClick={() => alert('likes')}>By likes</Button>,
      ]}
    ></PageHeader>
  </div>
);

export default Header;
